import React from 'react';
import { useContext } from 'react';
import { AppContext } from './contexts/app';


export function Home() {
    const [state,] = useContext(AppContext)
    const { user } = state
    return (
        <div>
            <p> user: {user.user}</p>
            <p> email: {user.email}</p>
        </div>
    )
}
